             的语言、访问日期和时间、软硬件特征信息及您需求的网页记录等数据）；
           </p>
           <p style="text-indent: 2em">
             c）惠域通宝通过合法途径从商业伙伴处取得的用户个人数据。
           </p>
           <p style="text-indent: 2em">
             4.2您了解并同意，以下信息不适用本隐私权政策：
