           </p>
           <p style="text-indent: 2em">
             4.3惠域通宝保护用户信息安全：
           </p>
           <p style="text-indent: 2em">
             a）为服务用户的目的，惠域通宝可能通过使用用户个人信息，向您提供您感兴趣的信息，包括但不限
             于向您发出产品和服务信息，或者与惠域通宝合作伙伴共享信息以便他们向您发送有关其产品和服务的信
             息（后者需要用户事先同意）。
           </p>
           <p style="text-indent: 2em">
             4.4在如下情况下，惠域通宝将依据用户个人意愿或法律的规定全部或部分的披露用户个人信息：
           </p>
           <p style="text-indent: 2em">
             a）经您事先同意和授权，向第三方披露；为提供您所要求的产品和服务，而必须和第三方分享用户个人信息；
           </p>
