             请求的，惠域通宝有权决定向该用户提供其交易对方的联络方式等必要信息，以促成交易的完成或纠纷的解决；
           </p>
           <p style="text-indent: 2em">
             f）其它惠域通宝根据法律、法规或者网站政策认为合适的披露。
           </p>
           <p style="text-indent: 2em">
             4.5惠域通宝帐号均有安全保护功能，请妥善保管用户用户名及密码信息。惠域通宝将通过对用户密
             码进行加密等安全措施确保用户信息不丢失，不被滥用和变造。尽管有前述安全措施，但同时也请您注意
             在信息网络上不存在“完善的安全措施”。在使用惠域通宝网络服务进行网上交易时，您不可避免的要向
             交易对方或潜在的交易对方披露自己的个人信息，如联络方式或者地址。请您妥善保护自己的个人信息，
             仅在必要的情形下向他人提供。如您发现自己的个人信息泄密，尤其是惠域通宝用户名及密码发生泄露，
             请您立即联络惠域通宝客服，以便惠域通宝采取相应措施。
           </p>
           <p style="text-indent: 2em">
             4.6为惠域通宝更好地向用户提供服务、用户同意向惠域通宝作出以下不可撤销的授权：
           </p>
