           </p>
           <p style="text-indent: 2em">
             （d）惠域通宝通过您在使用平台的数据分析得出包括但不限于数据分析报告、行业分析数据、商品经
             营数据产品等，惠域通宝可应用于商业分析和商业交易行为。
           </p>
           <p style="text-indent: 2em">
