             照与惠域通宝签订的服务协议或者与惠域通宝其他会员签订的协议等其他法律文本的约定履行自己应尽的
             义务时，惠域通宝有权根据自己的判断，或者与该笔交易有关的其他会员的请求披露注册用户的个人信息
