           </p>
           <p style="text-indent: 2em">
             7.3用户不得经由非惠域通宝所提供的界面使用惠域通宝。
           </p>
           <p style="text-indent: 2em">
             7.4尊重知识产权是注册用户应尽的义务，如有违反，注册用户应对惠域通宝承担损害赔偿等法律责任。
           </p>
           <p class="title">
             十、不可抗力
           </p>
           <p style="text-indent: 2em">
