           </p>
           <p style="text-indent: 2em">
             9.4用户理解并同意，因用户违反本协议约定，导致或产生的任何第三方主张的任何索赔、要求或损
             失，包括合理的律师费，用户应当赔偿惠域通宝与合作公司、关联公司，并使之免受损害。
           </p>
           <p class="title">
             十二、法律适用与争议解决
           </p>
           <p style="text-indent: 2em">
             10.1本协议是由注册用户与惠域通宝共同签订的，适用于注册用户在惠域通宝的全部活动。本协议内
             容包括但不限于协议正文条款及已经发布的或将来可能发布的各类规则，所有条款和规则为协议不可分割
             的一部分，与协议正文具有同等法律效力。
           </p>
           <p style="text-indent: 2em">
             10.2本协议不涉及惠域通宝平台用户与惠域通宝平台的其他用户之间，因网上交易而产生的法律关系
             及法律纠纷。但用户在此同意将全面接受并履行与惠域通宝平台其他用户在惠域通宝平台签订的任何电子
             法律文本，并承诺按照该法律文本享有和（或）放弃相应的权利、承担和（或）豁免相应的义务。
           </p>
           <p style="text-indent: 2em">
             10.3如本协议中的任何条款无论因何种原因完全或部分无效或不具有执行力，则应认为该条款可与本
             协议相分割，并可被尽可能接近各方意图的、能够保留本协议要求的经济目的的、有效的新条款所取代，
             而且，在此情况下，本协议的其他条款仍然完全有效并具有约束力。
           </p>
           <p style="text-indent: 2em">
             10.4本协议的订立、执行和解释及争议的解决均应适用中国法律并受中国法院管辖。如双方就本协议
             内容或其执行发生任何争议，双方应尽量友好协商解决；协商不成时，任何一方均可向北京市海淀区人民
             法院提起诉讼。
           </p>
           <p style="text-indent: 2em">
             10.5本协议发生纠纷时相关文件和法律文书送达时的送达地址及法律后果约定如下：
           </p>
           <p style="text-indent: 2em">
             1、用户确认其有效的送达地址为其向惠域通宝平台申请服务时确认的住宅地址，若用户未提供则以用
             户户籍地地址为有效送达地址；
           </p>
           <p style="text-indent: 2em">
             2、上述第1款约定的送达地址适用范围包括非诉时各类通知、协议等文件以及就协议发生纠纷时相
             关文件和法律文书的送达，同时包括在争议进入民事诉讼程序后的一审、二审、再审和执行程序；
           </p>
           <p style="text-indent: 2em">
             3、用户送达地址需要变更时应当通过书面方式通知惠域通宝平台并经惠域通宝平台确认,否则，因此
             造成的损失由用户自行承担。在民事诉讼程序时当事人地址变更时应当向法院履行送达地址变更通知义务；
           </p>
           <p style="text-indent: 2em">
             4、若用户未按前述方式履行通知义务，则本条第1款确定的送达地址仍视为有效送达地址，因当事
             人提供或者确认的送达地址不准确、送达地址变更后未及时依程序告知对方和法院、当事人或指定的接收
             人拒绝签收等原因，导致法律文书未能被当事人实际接收的，邮寄送达的，以文书退回之日视为送达之日；
             直接送达的，送达人当场在送达回证上记明情况之日视为送达之日；履行送达地址变更通知义务的，以变
             更后的送达地址为有效送达地址。对于上述当事人在合同中明确约定的送达地址，法院进行送达时可直接
             邮寄送达，即使当事人未能收到法院邮寄送达的文书，由于其在合同中的约定，也应当视为送达；
           </p>
           <p style="text-indent: 2em">
             5、纠纷进入民事诉讼程序后，如当事人应诉并直接向法院提交送达地址确认书，该确认地址与诉前确
             认的送达地址不一致的，以向法院提交确认的送达地址为准（该送达地址适用上述第4条规定的送达方式
             及送达的法律后果）。
           </p>
           <p style="text-indent: 2em">
             10.6若本协议的部分条款被认定为无效或者无法实施时，本协议中的其他条款仍然有效。
           </p>
           <p class="title">
             十三、其他
           </p>
           <p style="text-indent: 2em">
             11.1惠域通宝郑重提醒用户注意本协议中免除惠域通宝责任和限制用户权利的条款，请用户仔细阅读，
             自主考虑风险。未成年人应在法定监护人的陪同下阅读本协议。
           </p>
           <p style="text-indent: 2em">
             11.2本协议的任何条款无论因何种原因无效或不具可执行性，其余条款仍有效，对双方具有约束力。
           </p>
