<script>
import { isvalidUsername } from '@common/utils/validate'
import elDragDialog from '@supplier/directive/el-dragDialog'
import { notify } from '@common/utils/helper'
import { SupplierRegister, SendSms, SupplierResetPassword } from '../../api/login'
export default {
  name: 'login',
  directives: { elDragDialog },
  data() {
    const validateUsername = (rule, value, callback) => {
      if (!isvalidUsername(value)) {
        callback(new Error('请输入正确的手机号！'))
      } else {
        callback()
      }
    }
    const validatePassword = (rule, value, callback) => {
      if (value.length < 6 || value === '') {
        callback(new Error('请输入正确的密码！（最少6位）'))
      } else {
        callback()
      }
    }
    return {
      activeName: 'supplier',
      window: 'login',
      loginForm: {
        tabsLabel: 'supplier',
        mobile: '',
        password: '',
        code: '',
        invitation_code: '',
        remember_me: true,
        agree: true
      },
      loginRules: {
        mobile: [{ required: true, trigger: 'blur', validator: validateUsername }],
        password: [{ required: true, trigger: 'blur', validator: validatePassword }]
      },
      protocolDialog: false,
      remember: true,
      loading: false,
      showDialog: false,
      showCode: true,
      count: null
    }
  },
  created() {
    if (localStorage.getItem('login')) {
      this.loginForm = this._.cloneDeep(JSON.parse(localStorage.getItem('login')))
    }
  },
  methods: {
    handleClick(tab, event) {
      this.$refs['loginForm'].resetFields()
      if (tab.name === 'supplier' || tab.name === 'store') {
        this.loginForm.tabsLabel = tab.name
      }
    },
    // 返回登录页
    goBackBtn() {
      this.$refs['loginForm'].resetFields()
      this.window = 'login'
      this.activeName = 'supplier'
      this.count = null
      this.showCode = true
    },
    // 忘记密码
    forgetBtn() {
      this.$refs['loginForm'].resetFields()
      this.window = 'forget'
      this.activeName = 'reset'
      this.showCode = true
      this.count = null
    },
    // 查看协议
    lookProtocol() {
      this.protocolDialog = true
    },
    // 登录、注册、重置密码
    handleLogin() {
      this.$refs.loginForm.validate(valid => {
        if (valid && this.window === 'login') {
          this.loading = true
          this.$store.dispatch('Login', this.loginForm).then(() => {
            this.loading = false
            this.$router.push({ path: '/' })
            if (this.loginForm.remember_me) {
              localStorage.setItem('login', JSON.stringify(this.loginForm))
            } else {
              localStorage.removeItem('login')
            }
          }).catch(() => {
            this.loading = false
          })
        } else if (valid && this.window === 'register') {
          // TODO 注册接口
          if (this.loginForm.tabsLabel === 'supplier') {
            // 供应商注册
            SupplierRegister(this.loginForm).then(() => {
              notify.success('注册成功')
              this.goBackBtn('supplier')
            })
          } else if (this.loginForm.tabsLabel === 'store') {
            // 门店注册
            // CustomerRegister(this.loginForm).then(() => {
            //   notify.success('注册成功')
            //   this.goBackBtn('store')
            // })
          }
        } else if (valid && this.window === 'forget') {
          // TODO 重置密码接口
          if (this.loginForm.tabsLabel === 'supplier') {
            // 供应商重置密码
            SupplierResetPassword(this.loginForm).then(() => {
              notify.success()
              notify.success('密码重置成功')
              this.goBackBtn()
            })
          } else if (this.loginForm.tabsLabel === 'store') {
            // 门店重置密码
            // CustomerResetPassword(this.loginForm).then(() => {
            //   notify.success('密码重置成功')
            //   this.goBackBtn()
            // })
          }
        } else {
          return false
        }
      })
    },
    // 注册页面
    registerBtn() {
      this.$refs['loginForm'].resetFields()
      this.window = 'register'
      this.activeName = 'register'
      this.showCode = true
      this.count = null
      this.loginForm.mobile = ''
    },
    // 发送验证码
    sendCode() {
      this.$refs.loginForm.validateField('mobile', valid => {
        if (valid === '') {
          // TODO 获取验证码接口
          SendSms(this.loginForm.mobile).then(() => {
            const TIME_COUNT = 60
            if (!this.timer) {
              this.count = TIME_COUNT
              this.showCode = false
              this.timer = setInterval(() => {
                if (this.count > 1 && this.count <= TIME_COUNT) {
                  this.count--
                } else {
                  this.showCode = true
                  clearInterval(this.timer)
                  this.timer = null
                }
              }, 1000)
            }
          })
          // this.getSms(data)
        }
      })
    },
    afterQRScan() {
      // const hash = window.location.hash.slice(1)
      // const hashObj = getQueryObject(hash)
      // const originUrl = window.location.origin
      // history.replaceState({}, '', originUrl)
      // const codeMap = {
      //   wechat: 'code',
      //   tencent: 'code'
      // }
      // const codeName = hashObj[codeMap[this.auth_type]]
      // if (!codeName) {
      //   alert('第三方登录失败')
      // } else {
      //   this.$store.dispatch('LoginByThirdparty', codeName).then(() => {
      //     this.$router.push({ path: '/' })
      //   })
      // }
    }
  },
  destroyed() {
    // window.removeEventListener('hashchange', this.afterQRScan)
  }
}
</script>

